import React from "react";
import Button from "@material-ui/core/Button";

export default function ChangeRegiserWindowCmp(props) {
  return (
    <section className="change_regiser_window">
      <div>
        <h2>Hello, Friend!</h2>
        <span>{props.text_window}</span>
        <button
          onClick={() => {
            props.changeButton();
          }}
        >
          {props.button_name}
        </button>
      </div>
    </section>
  );
}
